policy_welcome: "Thanks for visiting my shop! I love fun stuff, I love vintage stuff, and I really LOVE bargains so you&#39;ll find many small vintage items here that can be shipped to you at minimal cost - patterns, books, ephemera, and small collectibles. I&#39;ve also started listing some very cool rustic and retro stuff like signs, baskets, and vintage clothes and more of that will be coming each week.",
policy_payment: "You can pay for your items with a credit card, Etsy gift card or through PayPal. Those are the forms of payment I accept.",
policy_shipping: "My books are shipped media mail. This can be a slow method of delivery although sometimes it only takes a few days. If you need your book more quickly let me know before your purchase. I will get back to you within a day with shipping quotes for parcel post and priority mail (Big Mama never sleeps). Items that do not qualify for media mail are shipped Standard Post/First Class unless it&#39;s less expensive to use the flat rate priority mail boxes/envelopes. Once again, if you would like to upgrade just get in touch with me before you purchase. I&#39;ll do all I can to make it work. Smaller items (1 pound or less) have the correct shipping cost. For heavier items, my shipping charge is an estimate based on what the cost would be to ship across country. Shipping to you could be less and anything over $1 in excess postage will be refunded to you. If you&#39;d like a quote based on your location let me know and I can do that before you purchase! Vintage dress patterns are mailed in padded envelopes. The shipping on vintage patterns to U.S. addresses is $2.90. Purchase one other vintage pattern at the same time and it will be added to the envelope with no additional shipping charge! International Shipping: If you live outside the US and are interested in one or more of my items please contact me for shipping costs. I&#39;d rather give you an exact cost than include a high shipping price that may be much more than it should for your country. Most of my items include the shipping cost to Canada. I add tracking to packages but if you&#39;d like insurance please let me know in advance and I&#39;ll add that to your total cost. ",
policy_refunds: "Most of the items in my shop are vintage and have been used by someone. I try to show flaws in the photos and note them in the descriptions. If you have specific questions please ask. I will take returns on things that I&#39;ve made some sort of error in describing. There are no postage refunds and it will be your responsibility to ship the item back to BigMamasBasement in the same condition received before any refund can be issued.",
policy_additional: "Please keep checking back. Big Mama has been finding lots of cool vintage stuff. If it&#39;s not here today it might be tomorrow...",
