title: "Handmade flasks to match every personality!",
announcement: "Welcome to Liquid Courage Flasks! We are a husband and wife team that left our corporate cubicles and started our business on Etsy in 2010. We print our designs on high quality vinyl for durability. Personalize any flask in our shop with your name, initials, or picture. Convo us or call us at (888) 959-2870 with any questions. Be sure to sign up for our newsletter to stay up to date with our latest designs, discounts, and giveaways! NEWSLETTER SIGNUP LINK: http://eepurl.com/FP_fT",
