sale_message: "Thank you for your purchase from Liquid Courage Flasks! Be sure to sign up for our newsletter to stay up to date with our latest designs, discounts, and giveaways! NEWSLETTER SIGNUP LINK: http://eepurl.com/FP_fT -Shipping- Our items typically ship within 2 business days and have an estimated delivery time of 2-5 business days within the United States. If you purchased a custom item, a convo will be sent to you shortly to request more information or to approve a mock up. Please let us know if you have any questions. -International Shipping- International shipments have an estimated delivery time of 6-10 business days from the time of shipment. Please note that the shipping time may vary due to customs policies in your country. International customers are responsible for all Destination Duties, Taxes, and Import Charges. If you have any issues with your order at all. Please be sure to reach out before leaving feedback. We will do everything within our power to correct the situation. Thanks! Amy and Tyler Fisk Liquid Courage 888-959-2870 sales@liquidcourageflasks.com",
