description: "Custom Liquor, Wine, or Champagne labels are the perfect way to pop the question to your Groomsmen & Best Man. :::::::::::::::::::::: ABOUT OUR LABELS :::::::::::::::::::::: This set of self-adhesive labels is designed to fit liquor flask, wine or champagne bottles. We recommend bottles with a straight body with higher shoulders. All of our labels are WEATHERPROOF and REMOVABLE. They are ok to be chilled or put on ice and are meant to survive any party! Choose your colors to match your wedding Great for Bridesmaid or Maid of Honor gifts too! :::::::::::::::::::::: DESIGN :::::::::::::::::::::: This label&#39;s design reads: NAME Will you be my (TITLE) (If you say no, I want this bottle back) BRIDE & GROOM&#39;S NAMES Month DATE Year....of your wedding * Copyright Label With Love 2014. Do not copy. * Text can be changed and be used as Thank You gifts. Please send us a message prior to ordering to be sure we can accommodate your changes. : : : : : : : : : : : : : : HOW TO ORDER : : : : : : : : : : : : : : We are excited to create your labels, and we have just a few requests to ensure we see all of your details correctly and to expedite your order: •	Please write all information just as it should appear on the labels. We will copy dates exactly as provided. •	Write out each detail on it&#39;s own line •	We kindly request that ALL CAPS be used only when necessary, or if you would like certain details in all caps. 1. Leave the &quot;Quantity&quot; set to 1 2. Click &quot;Add to Cart&quot; 3. TO CUSTOMIZE Open your Shopping Cart and find the box titled &quot;Notes to LabelwithLove&quot; and enter the following details: •	Bride and Grooms Names •	Wedding Date •	Groomsmen&#39;s and Best Man&#39;s First names (or any additional titles) • NEED BY DATE (Important if you have an event coming up) : : : : : : : : : : : : : : ABOUT OUR LABELS : : : : : : : : : : : : : : - Your set of labels is personalized with your details and color choices prior to printing and cutting - All of our labels are Made to Order and Shipped 3-4 Business Days following your purchase. - Our self-adhesive labels are made to fit a standard flask or bottle (*see below for our tips for selecting the best bottle to use) - Labels measure 3.33&quot; x 4&quot; inches and are individually cut and ready to apply to your bottle. - All of our labels are WEATHERPROOF and REMOVABLE. They can chilled or put on ice, and are meant to survive any celebration! - WATERMARK will not be printed on the labels *Wine Bottles not included : : : : : : : : : : : : : : PRODUCTION : : : : : : : : : : : : : : We want to get your labels to you as soon as possible, so we only send proofs upon request at this time. Our quality and packaging team double and triple check your order notes against the actual labels before they ship to be sure everything is correct. If you would like to see a proof of what will print, include a note with your order stating PROOF REQUEST (in all caps). We start designing your custom labels 1 business day after we receive your order. Any changes to your order must be make within 1 business day of purchase to avoid any additional design or reprint fees. If, for any reason, you receive labels that do not reflect your information provided at checkout, please let us know and we will ship new labels to you within 1 business day with Priority shipping. This is an extremely rare occurrence and we try our very best to operate with 100% perfection, but we understand mistakes can and do happen and we are happy to correct any errors on our end right away. * Due to our high volume of orders, we do not send proofs prior to purchase : : : : : : : : : : : : : : SHIPPING : : : : : : : : : : : : : : All items will ship 3-4 business days following your order. We ship from our studio in Palo Alto, CA via USPS First Class Ground, with ship time quoted at 3-6 business days within the US. Please refer to our policies for more details about expedited and international shipping:https://www.etsy.com/shop/LabelWithLove/policy?ref=shopinfo_policies_leftnav IMPORTANT - Unless otherwise stated, items will ship to the address on file with Etsy. If you need us to ship to a different address, please make a note with purchase. UPGRADES: If you need faster shipping, you will be able to upgrade in your shopping cart.Shipping Upgrades to Priority or Priority Express are upgrades to the shipping only. International shipping upgrades are available upon request. RUSH ORDERS are available only if our production schedule will allow it, especially during peak wedding season. Please contact us prior to purchase for pricing and availability. * Please refer to our Shop Policies for Shipping Times and Expedited Shipping Options: https://www.etsy.com/shop/LabelWithLove/policy?ref=shopinfo_policies_leftnav Thank you again for stopping by Label with Love. We look forward to helping you celebrate life&#39;s best moments! Xo, Cyra and Andrea : : : : : : : : : : : : : : FREQUENTLY ASKED QUESTIONS : : : : : : : : : : : : : : WHAT TYPE OF BOTTLE SHOULD I USE WITH MY CUSTOM LABELS? When selecting your a bottles for your custom labels, the shape is important! We prefer smooth bottles with a body that&#39;s the same width from top to bottom, and have tall shoulders. You want to avoid wine and champagne bottles have funny shapes or odd textures. To give you a better idea, most Cab and Sauvignon Blanc bottles will work, as well as champagne bottles similar to the shape of Veuve or Moet Chandon. You also want the body to be taller than your custom labels. If the body is too short, you might find the labels will bubble at the top or bottom once applied. : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : HOW DO I REMOVE THE EXISTING WINE LABELS FROM MY BOTTLES? It may sound like a daunting task, but it&#39;s really quite easy. We promise! We&#39;ve even created a step by step video to walk you through the process. Hop on over to our website for our Removal Video and Application tricks: http://www.labelwithlove.com/instructions/ : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : DO I RECEIVE A PROOF OF MY LABELS BEFORE YOU SHIP? We want to get your labels to you as soon as possible, so we only send proofs upon request at this time. Our quality and packaging team double and triple check your order notes against actual labels before they ship, to be sure everything is correct. If you would like to see a proof of what will print, include a note with your order stating PROOF REQUEST (all caps). : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : HOW LONG DOES SHIPPING TAKE? Visit our Policies page here for more details about our shipping lead times: https://www.etsy.com/shop/LabelWithLove/policy?ref=shopinfo_policies_leftnav : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : I WANT A COLOR SCHEME DIFFERENT FROM WHAT IS SHOWN. CAN I CHOSE CUSTOM COLORS? If you would like to use a color option different from what is shown in the listing, please send us a message and we can let you know if it will work. Please note, additional design fees may apply for custom color changes. : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : : COPYRIGHT - Designs, Wording, and Listing Details are registered Copyright © Label with Love 2014-2015 and may not be copied, reproduced, or sold in any way without prior written consent. The images shown are property of Label with Love Designs. We work really hard to bring you designs from the heart. Please do not copy.",
