policy_refunds: "Because all of our labels are made to order, we do not offer full refunds once the design process has begun. We do want all of our customers be happy so we will do whatever we can to make that happen. Cancellations will be authorized only if we have not started designing your order. If you decide to cancel your order after the the design process in underway, we are happy to offer you a partial refund of your order. { DAMAGED LABELS } If for any reason your labels are damaged in transit from us to you, we are happy to send you a new set. We trust the USPS for the most part, but we understand that things happen. Label with Love is not responsible if your label rips or wrinkles during the application or removal process, or if the adhesive is compromised once removed from it&#39;s backing. While our labels are very durable, we do recommend that you take great care when placing them on your bottle. Please visit our website for details instructions for our recommended application process: http://www.labelwithlove.com/instructions/ { SPELLING ERRORS or INCORRECT DETAILS } If, for any reason, you receive labels that do not reflect your information provided with your order, please let us know and we will ship new labels to you within 1 business day with Priority shipping. This is an extremely rare occurrence and we try our very best to operate with 100% perfection, but mistakes can and do happen and we are happy to correct any errors on our end right away. We are not responsible for spelling errors provided to us. We will copy your information provided, so it&#39;s important to review your order details and let us know if there should be any changes within 1 business day of purchase. { COLOR STANDARDS } We try our best to ensure our printed colors match what you see on your screen (or as close as possible). Please note, every monitor or phone is a little different, so there may be a discrepancy between your printed product and the item shown on your screen. We do not offer refunds if your colors are not identical your screen.",
policy_additional: "* To prevent any delays in the process, please be sure to include all details for customization at the time of purchase. Please note, if we run in to any issues with your custom color choices or special requests, there may be a slight delay with your proofs so that we can chat with you regarding the changes. { TURNAROUND AND BUSINESS HOURS } * Standard Turnaround - 3-4 Business Days (we are closed weekends and holidays) * Rush Turnaround - 1 Business Day We start designing your custom labels 1 business day after we receive your order. Any changes to your order must be made within 1 business day of purchase to avoid any additional design or reprint fees. PROOFS We want to get your labels to you as soon as possible, so we only send proofs upon request at this time. If you would like to see a proof of what will print, include a note with your order stating PROOF REQUEST (in all caps). * Proof Turnaround - 2-3 Business Days STANDARD HOURS OF OPERATION Printing/Shipping Mon - Fri: 9 am - 4pm PST Sat, Sun, Holidays: CLOSED Proofs/Design Time Mon - Fri: 9am - 10pm HAWAII STANDARD TIME Sat, Sun, Holidays: CLOSED Messages/Inquiries Mon - Fri: 8am - 8pm PST Sat, Sun, Holidays: We like to reserve this time for our family and friends, but understand that our shop is a 24 hours business. While we are technically closed weekends and holidays, we usually respond as soon as we are near a computer or near our phones. BULK ORDERS Have a wedding or corporate event with a long guest list? Large quantity orders are available at a wholesale discount. Please message us for a quote.",
