sale_message: "Thank you SO much for your business! YOU are awesome! We love our customers and will make every effort to get your items to you as quickly as possible! Please bear with us during our busy seasons, we are working as fast as we can! ☆ Visit our new website for additional fun products! www.thebeardedbee.us ☆ You can join our email list to receive discounts & coupon codes via: http://tinyurl.com/l8m5ysy DOMESTIC (U.S.) SHIPPING : --------------------------------------- ♥ Current turn around is 2-5 Business Days. You will receive an email with tracking when your order dispatches. Packages ordered with standard shipping usually arrive within 2-5 business days of shipment via USPS. For items under 16 oz USPS first class is the standard delivery method and for items over 1 lb USPS Priority Mail is the standard service. ♥ If you are unable to receive USPS packages, contact us and we can set up another service for you. ♥ Need it in a Hurry? We do our best to offer the least expensive and most effective rates possible on standard shipping, but we know some items are needed quickly. We offer expedited shipping via USPS Express Mail (1-2 business days). All upgraded shipping orders will be rushed out as quickly as possible to ensure the quickest delivery. Since there is a cutoff time for express shipments, please allow up to 1 day for the item to be shipped out. If you have any questions or need an item by a specific date, contact us and we&#39;ll be happy to help arrange the best shipping method for your needs. ♥ USPS does not guarantee shipping times unless USPS Express Mail is used (1-2 business days). ♥ Signature Confirmation can be added separately to USPS orders and is recommended for those in apartments and urban areas. INTERNATIONAL SHIPPING: ------------------------------------- ♥ We&#39;re based in the US & love shipping to our international friends!! We are now able to offer the best rates possible. International shipping normally takes 2-5 weeks with the standard economy rate service. Processing time is 1-5 business days prior to shipment. ♥ We ship to all countries; however, buyers in Brazil, Vietnam, Philippines, or anywhere in Africa must contact us beforehand to arrange shipping for their items. These countries tend to have regular issues receiving packages and will be required to use a different shipping service with mandatory tracking and insurance. ♥ The standard international shipping service has limited tracking to some destinations. Please consider upgrading your shipping option if door-to-door tracking and speed of delivery are important. You can contact us to set up rush delivery as the cost will vary by item an country. ♥ Please be aware that you may be charged certain international CUSTOMS FEES/TAXES according to your country&#39;s rules and regulations, which are not in our control and are not included in the shipping price. You are responsible for paying them to your postal courier. If you refuse the package & it is returned to us, your shipping will not be refunded. IF YOU HAVE ALLERGIES: ----------------------------------- ♥ While some of our items are made of synthetic materials, they can still come in to contact with other products that contain natural or animal fibers (i.e. cotton, wool, angora, etc.) while in storage. If you have ANY allergies, be sure to notify us beforehand and also clean your garment(s) upon receiving them for this reason. LOST PARCELS: ---------------------- ♥ We ship to the address that you provide upon checkout and do not take any liability in the case of lost or returned parcels. Please contact us, if you believe your package is being returned to sender because of an incorrect address, and we will work with you to make sure it arrives safely. New postage will need to be purchased by the buyer to re-ship misaddressed items. PLEASE Double check your shipping address, especially Paypal customers. ♥ If your package tracking status is marked &#39;delivered&#39; and you do not receive your package, you will need to check with your household members, neighbors, post office, and postman. Unless you added signature confirmation, or upgraded to Express Mail, we cannot be responsible for any packages stolen from your home or complex. Thank you for your cooperation & have a wonderful day! All the best, Sara + Bryan ",
