policy_welcome: "Hello, and thanks for stopping by!! Check out our website, www.thebearded,bee for other unique items not featured on our Etsy store! ",
policy_payment: "We strongly prefer immediate payment via PayPal or Direct Checkout. Orders will be shipped within 1-5 business days of payment being processed unless otherwise noted. If you use an e-check, shipping may be delayed up to 10 business days (due to PayPal transaction times). ",
policy_shipping: "Shipping time varies by destination & post office. Orders within the US typically arrive within 1-7 business days of being shipped out (ship time is different than processing time). Processing time depends on the time of year but is typically no more than 5 business days. ****PLEASE MAKE SURE YOUR SHIPPING INFO IS CORRECT!!!**** If a package is returned to us due to an incorrectly provided shipping address, the buyer will be responsible for covering the cost of re-shipping the item. All orders are shipped to the shipping address on your Etsy invoice. Please ensure that your address is current on your Etsy account - orders delivered to incorrect addresses are not retrievable by us once shipped and are non-refundable. INTERNATIONAL: All international orders are shipped via USPS, or one of their third parties unless otherwise requested. We are unable to accurately track some international orders that are shipped via any method other than Fedex. We only have information about the package until it leaves the US, as not all countries will scan the tracking info. Depending on the destination, international packages typically take anywhere from 1-5 weeks to arrive. Unfortunately, we cannot make any ship time guarantees for international deliveries unless you upgrade your shipping to Fedex 1-3 day guaranteed shipping. Orders to Italy, Vietnam, Singapore, Tasmania, Brazil, & remote destinations tend to take longer than average to process through customs. We no longer offer shipping to African countries. **We have done our very best to offer the most economical and cost effective rates possible with standard international shipping, but again please keep in mind this is the least time sensitive. We have no way of guaranteed tracking on orders with this service. If you are interested in receiving your item quickly, or require accurate tracking, please upgrade your shipping, or contact us beforehand!** Please note that our shipping charge only covers the cost to ship and insure your items. It does not cover any additional brokerage fees and/or import taxes you may incur from your country&#39;s customs office. INTERNATIONAL CUSTOMS: (Especially EU buyers): Please take into account that items may be held for additional import/VAT fees in your country of residence. These fees are separate from your purchase with us, and it is your responsibility to pay them. LOST MAIL: To prevent mis-delivery or theft, we encourage that buyers add signature confirmation to their order when checking out (especially if you live in an apartment complex or urban area). If a package is lost in the mail, please contact us and we can help you file a claim with the shipping carrier. If the package is not received & the tracking status is marked &quot;delivered&quot; by the carrier, you will need to check with your neighbors, household members, and local post office. Due to escalated cases of theft & fraud, we cannot reimburse, refund, or send you a new item if the package tracking says that it was successfully delivered to your home. ",
policy_refunds: "All items, with the exception of earrings, can be returned for a refund. To initiate a return, please contact us via Etsy message. Please include a note somewhere within the package with your full name & order number so that we can process the refund quickly. Refunds are for the item cost only, and do not include shipping costs. All returns/exchanges must be made within 14 days of product sale date. Orders may be cancelled before they have been post-marked. Cancelled orders will receive a full refund, minus any small fees incurred via the method of checkout. ",
policy_additional: "All vintage items are previously owned. Due to the nature of vintage clothes, we suggest washing your newly purchased item(s) before wearing. If your item has a tag with wash/care instructions, we highly advise you follow them (some items may be dry clean only, etc.) We strive to ensure all of our vintage items are free from stains, rips, tears, pulls, etc. If for some reason there is any irreparable damage to an item, it will be clearly communicated in the item&#39;s description and photo(s). If you are allergic to any specific materials, PLEASE make note of it in the comments box at checkout. We will not be held responsible if you do not disclose this information at the time of purchase. ",
