announcement: "Your purchase ships next business day in a lovely gift box. Welcome to our shop specializing in beautiful and AFFORDABLE gemstone jewelry. Most of our beautiful jewelry is priced under $40 USD....what a bargin. All of the jewelry at JJewelsATL is handcrafted by the artists themselves, each piece lovingly constructed using unique beads, crystal, gemstones and precious metals. Every handmade jewelry piece is a unique, one-of-a-kind design and exists as part of a limited edition line of fine artisan jewelry. We specialize in jewelry handcrafted with Amethyst, Peridot, Carnelian, Chalcedony, Citrine, Garnet, Topaz, Lemon Quartz, Ruby, Sapphire, Emeralds, Pearl, Crystal and more. Custom design and color requests are welcome as well as larger quantities. The handcrafted earrings, necklaces, and bracelets at JJewelsATL are designed to accentuate both the charm and uniqueness of their wearer. Note that most of our creations are made from natural gemstones. As with any natural gemstone, there may be slight inclusions that nature has used to make each piece truly unique. Our close up photography shows you the detail of each piece so you can see what you are getting before you purchase it. Items may appear larger in photos, dimensions in descriptions are accurate. ================================================================ ",
