policy_payment: "We gladly accept payments via PayPal. Here is a great tutorial if you are new to Etsy or PayPal. Using this secured online payment method is a breeze: http://www.etsy.com/storque/how-to/how-to-pay-with-a-credit-card-and-create-a-paypal-account-746/",
