policy_refunds: "We want our customers to be happy and buy from us again. Please convo us if you have any issues with your purchase before leaving negative feedback. We will try to resolve issues to your satisfaction. Close up photographs are taken to show the quality and craftmanship of our jewelry with the color shown and measurements stated as accurately as possible, but keep in mind that colors can appear different on different monitors and images may appear larger due to the macro photography. If you are unhappy with your purchase, you may return the jewelry within 10 days of receipt as long as jewelry is unworn and in the original packaging. You will receive a refund for the purchase price minus all shipping and tax fees once the jewelry has been received by us in its original condition. Buyer is responsible for shipping cost, fees and taxes for returned items. Custom orders are non-refundable. ",
