policy_welcome: "Thank you for visiting Sip Hip Hooray! We are happy that you have stopped by. Design is our passion and we love sharing it with the world! Our shop hours are Monday-Friday 8am-5pm central time. NOTE: Although I do have a tendency to respond outside of shop hours, sometimes our order volume is higher than others and your response can take up to 24 hours and may only be during the parameters of our business hours. ",
policy_payment: "Sip Hip Hooray only accepts Paypal and credit cards through Etsy for purchases. We do not accept checks or money orders. Payment is due at the time of purchase. If payment is not received within 24 hours, your transaction will be canceled and the item will be re-listed. DEPOSITS | Custom Work - a $25 deposit is required to start work on custom project. This deposit is non-refundable and is required for your first proof. The deposit will be deducted from the total of your order. Full payment is required before printing will be processed or digital files are provided. Printed proofs are available for a fee once the deposit has been received. DIGITAL FILES + INVITATIONS | Custom or Template - Purchase of listing or deposit must be processed before work will begin. Proofs will be sent to the email listed on your Etsy account 1-2 business days after your purchase. All information must be provided to us for work to begin. The file provided to you will be a High Resolution JPG. I can add bleeds or change up file size per your request if your printer has specific set up requirements. When you receive your proof you will be asked to submit your revisions. Please check thoroughly for misspelling, correct colors, punctuation, capitalization, all information on design, etc. Once approved, we are not responsible for an errors. ***Your order WILL NOT print until your proof is approved. CHANGES | We strive to satisfy every customer 110%. I do not have a max on changes and am willing to work with you until you are completely satisfied. ",
policy_shipping: "DIGITAL DESIGN | All digital pieces are delivered to the email address on your Etsy account. Please make sure it is correct, we do not always cross reference your Etsy email address with your Paypal email address. If needing delivery to a different email address, please leave it in the &quot;note to seller&quot; box upon checkout. PRINTED INVITATIONS | All shipping is ground shipping, 3-5 business days. From the time of approval, please allow 1-3 business days for pieces to process through printing and ship. CAN COOLERS, CUPS AND NAPKINS | Please allow 2-3 weeks from the time of final proof approval for normal production and shipping turnaround. All orders are shipped to the address on your PAYPAL/Etsy account. We ask that you verify that the address listed is your correct and current shipping address before submitting your order. We are not responsible for packages that are shipped to the wrong address due to inaccurate information provided or packages that are lost in the mail. A Rush Production and Shipping option is available for an additional fee. Please inquire for pricing. We are not liable for late deliveries due to postal shipping delays, or color variations due to computer monitors. ",
policy_refunds: "All products are custom designed and printed upon client approval, therefore we do not accept returns. However, if there is an error on our part, we will gladly send a replacement that correctly reflects your order or refund the order amount. We do not refund shipping. ** CHECK YOUR PROOFS carefully. We are not responsible for any errors (spelling, wrong information, etc) after the proof has been approved by you and the order has been printed. There will be a charge for re-printing. ** PRINT COLOR | Please note that colors can vary slightly due to the monitor they are viewed on. ",
policy_additional: "We thrive on custom work. Please message us with any requests and we will be happy to work towards your print and design wants and needs with you. We are full service stationery as well as corporate design and printing company. Some of our additional products include but are not limited to... WEDDING Engagement Party Save the Dates Wedding invitation Bridal Shower Couples Shower Wedding Announcements Rehearsal Dinner Bachelorette Party Bachelor Party Addressing Mailing Service Wedding Essentials Wedding Party Cards Programs Menus Place Cards Escort Cards Table names/Numbers Candy Table Signage Guest Book Table Signs Advice Cards Recipie Cards Thank You Cards Favor Tags BIRTHDAY Adult Kids BABY Baby Shower Birth Announcements Embroidering CORPORATE Corporate Events Banners Business Business Cards Post Cards Press Packages Complete Branding Logos Website Design Promotional Materials Embroidering Company Event Invitations Lifetime Celebrations Graduation Retirement Anniversary Social Stationery Thank You Cards Note Cards Letterhead Moving Announcements HOLIDAY Personalize Your Christmas Cards Photo Cards Party Invites Open House For all printed invitations and announcements, there is a minimum order of 25 pieces. For business cards, the minimum is 100. DISCLAIMER By visiting Sip Hip Hooray shop, you agree that you will not copy, print, download or otherwise reproduce any part of Sip Hip Hooray&#39;s products by any means without consent/purchase. When submitted photos for use, you are stating that you have all appropriate consent from your photographer to reproduce a printed piece using that image, be that written or verbal, and Sip Hip Hooray is not responsible for any legal matters. ",
