title: "Keepsakes Worth Keeping",
announcement: "Personalized engraved keepsake gifts for every occasion. Weddings, Anniversaries, Birthdays and Holidays! Weddings - toasting glasses, groomsman and bridesmaid gifts, parents gifts, table centerpieces, candleholders and memorial vases; anniversaries - champagne flutes, glasses; birthdays - shot glasses, mugs, ammo cans; or special events. No order is too large or too small. We can also engrave in another language if you provide the translation. Trust in the Lord with all your heart and lean not on your own understanding; in all your ways acknowledge Him, and He will make your paths straight. Proverbs 3: 5-6",
