vacation_message: "We will be closed until Friday, May 18, 2012. We will answer emails during this time if you have any questions. ",
sale_message: "Until your item is shipped, please check your Etsy email daily in case we have any questions about your order! We ship within the Continental United States via USPS or FedEx ground depending on the package size and location. We are not responsible for delays from the shipping carriers for weather or increased package volume during the holidays. If you love the item, tell others by leaving us a favorable review! Thanks so much!",
