policy_welcome: "Thanks for visiting Hummingbird Hill. We are a small family shop, that&#39;s why so many different mediums: engraved glassware, fused and art glass, ceramic violet pots and engraved glass listed in our shop. The engraved glass can be personalized, just ask for a custom order! ",
policy_payment: "For personalized and custom engraved items - we will begin your order after payment has been received. You will receive an email confirming your order and expected shipping date. Contact us within 3 hours if an order needs to be cancelled. If you cancel your order after the item has been engraved, we will only refund the shipping cost.",
policy_shipping: "We ship within the Continental United States via USPS or FedEx ground depending on the package size and location. We are not responsible for delays from the shipping carriers for weather or increased package volume during the holidays. Etsy does not currently allow for actual shipping. Our shipping costs are calculated with extra packing materials. We use a lot of packing to insure your item isn&#39;t damaged during shipping. We do refund the difference if the estimated shipping costs were higher than the actual shipping cost. Please check your Etsy convos until the item is shipped just in case we have a question or email you a proof. Please note that buyers are responsible for any and all duties and customs charges that may be incurred. Please allow up to 40 days for International orders due to packages being held at customs. If for any reason the address you entered on the invoice was incorrect and the package is returned to us we will contact you as soon as we can. A private listing will be set up for you to purchase the postage a second time with a new shipping address.",
policy_refunds: "Items cannot be returned or exchanged once they have been personalized. Please, please, please double check all spelling and dates prior to submitting your order. In the event that we make an error, we will either replace the item or offer a full refund. Items that have not been personalized may be returned for a refund less shipping costs within 10 days. Before you leave negative feedback we would appreciate the opportunity to fix, replace or refund a product if you are not satisfied. It is very important to us that you are happy with your purchase.",
policy_additional: "All of our engraved, fused and art glass is made in the USA. We do our best choosing the highest quality glass. However, small bubbles and swirls in the glass are normal, since glass is made with organic materials, and will not affect the glassware. Our candleholder/vases are hand blown glass. There is usually a small bubble on the rim where the glass is separated from the glass blowing tube. All pieces are created by hand, so no two items are identical. If an item is listed with more than one item for sale, please allow for slight variances from what is shown in the photo. We can direct ship the item and include a note if this is a gift. Please include what you would like written on the note in the comments box during checkout. We will only include an invoice upon request. Invoices can always be printed from your Etsy account at any time. We do not engrave profanity, vulgar, defamatory or derogatory designs. We use ceramic molds to make our violet pots, but when clay dries it doesn&#39;t always dry evenly which can cause small gaps between the insert and the base. We strive for perfection, yet that&#39;s what makes handmade items unique - they aren&#39;t perfect! ",
policy_seller_info: "Please check your Etsy convos until the item is shipped just in case we have a question or email you a proof. ",
