policy_welcome: "“All Liquored Up” was opened in 2014 as a way to share the things I love to make with others. I design and create all the items I sell in the shop, and I enjoy upcycling all things liquor into fun décor items! All my listed items are hand finished and will all be uniquely different. Custom orders are always welcomed, as I enjoy making items people will love. Feel free to contact me with any requests! Be sure to check out my other shop That Special Touch: handcrafted rustic home décor for rustic and vintage inspired items that will add “that special touch” to your home. etsy.com/shop/katiesspecialtouch ",
policy_payment: "All Liquored Up accepts credit cards via direct checkout, PayPal, and Etsy gift cards. Orders must be paid in full before shipping. In stock items ship in 1-2 business days, and made to order items ship in 3-5 business days. Please keep this in mind when ordering, and if you need an item sooner please don&#39;t hesitate to contact me about rushing your order. Order cancellations must be made before the items ship.",
policy_shipping: "All Liquored Up ships via USPS Priority Mail for most items, and large and heavy items will be shipped via standard ground shipping for cost efficiency. However, if you need an item shipped by a different method, feel free to contact me. All Liquored Up currently ships to United States, and internationally by request.",
policy_refunds: "Customer satisfaction is my main priority, and my hope is that you love the item you purchase. If however you change your mind when your order arrives you may return it for a full refund with return shipping being at your expense. Returns must be made within 10 business days after arrival of your order, and you must contact me beforehand about the circumstances of your return. Refunds will only be given on items returned in the same condition that I sent them in. **Please note: sales are final on all clearance items and custom orders.** If an item should arrive damaged, please contact me as soon as possible with photos and a written description so I can correct the problem for you.",
policy_additional: "All items are handmade and/or hand finished. Distressing and finishing are meant to be unique and will differ slightly among like items. Some items are in stock and ready to ship, and some items are made to order in your choice of color or finish. If you see an item you would like in a different size, color, finish, etc feel free to convo me. I will be happy to make a custom order for you whenever possible. I enjoy creating items that are unique to each customer! ",
