accepts_custom_requests: false,
policy_welcome: "Welcome to The Vintage Porch. My goal is 5 Star Customer Service and Satisfaction and to offer exciting treasures at affordable prices. Your purchase will be packed and shipped with tender loving care within 1 - 3 days of purchase. I ship internationally. See notes regarding international shipping in our Shipping Policy below. ",
policy_payment: "We accept Paypal, Visa, Mastercard, American Express and Discover.",
policy_shipping: "Shipping is completed within 1 to 3 business days from date of purchase. I am happy to combine shipping on multiple purchases if I can safely do so without risking breakage. Any shipping overages that are paid will be promptly refunded when shipped. How are Shipping costs determined? My shop is located in Indiana. The USPS bases the shipping fee on the distance being shipped (based on postal zones) and the weight and dimensions of the package. The shipping fees shown are based on shipping from Indiana to the far west coast USA. Your actual shipping fee may actually be less depending upon your location or the destination of your purchase. Any overages paid will be promptly refunded when shipped, we do not make a profit on shipping fees. What if your purchase is a gift? If you are purchasing a treasure for a gift and would like to have it shipped directly to the recipient, no worries about receipts or invoices. I never put a paper copy in with my packaging. You will have a copy on your computer. Your gift recipient (if you choose to have it shipped directly to them) will not see any of the paperwork. For International Shipping - I ship internationally and strive for the most economical method of delivery. Please convo me with your Ship To address and I will give you the shipping charge amount prior to your purchase. Seller is not responsible for any VAT or Customs charges that may be imposed.",
policy_refunds: "We accept returns for any reason within 14 days of receipt. If you simply change your mind, return your purchase in the same condition received and in the original packaging and your purchase price of the item will be refunded promptly when I receive the item back. The shipping expenses incurred are the buyer&#39;s responsibility. If you feel the item pictures or description grossly misrepresents the item, seller will assume responsibility for all shipping, including return shipping. I provide detailed pictures and a thorough description, purchase with confidence.",
policy_additional: "Just a mention that items from my shop are vintage items, not new items. All have been previously owned and as with most vintage items, they are gently used and may show signs of use and wear. I try my best to give an accurate description. I will note in the item description any sign of wear that would affect the functionality or overall appeal of the item. If you are looking for Coco&#39;s Vintage Closet, my other Etsy shop, please note that I have moved all of Coco&#39;s inventory on Etsy to The Vintage Porch shop. Coco&#39;s Vintage Closet is on Holiday.",
