announcement: "We welcome you to Light and Laughter Etsy... we are so glad you are here! Come in to sunshine and cheer . . . we hope you will enjoy browsing our wares. DISCOUNT COUPON CODES CAN BE FOUND ON FACEBOOK! Like us to keep abreast of happings here on Etsy. https://www.facebook.com/Light-Laughter-215259031951444 TO VIEW ALL CURRENT SALE ITEMS type &quot;sale&quot; in the shop search. We will bring sales and discounts on specific items to you on a regular basis....so check back regularly. If you plan to purchase multiple items, please don&#39;t hesitate to ask for a combined shipping quote prior to placing your order. We make our best effort to accurately estimate shipping costs. If our shipping estimates are in question, please don&#39;t hesitate to inquire. We will gladly refund any overages to our customers (over $2) but only AT YOUR REQUEST. About our shop and beyond: We bring to you an array of fun, useful and beautiful things that we personally love. Our little shop is dedicated all things handmade, vintage & re-purposed to feather your nest and dress your best. Among our treasures you will find clothing and accessories, vintage household goods, linens and lace, papercraft, pretty glassware and china, children&#39;s items, books and many other unique holiday treasures. We invite you to join us as we present a dash of light and laughter for enjoyment of family and home. Our Etsy shop is always changing! In an effort to keep up with the current trends and holidays, you can enjoy our shop&#39;s front window as we populate it with items that correspond with the months and seasons. Things will change frequently...so don&#39;t miss out. We have many finds to add and too many ideas and creative dreams to bring you all at once. Check back often, you never know what you&#39;ll find! We are thankful for our young helpers--budding photographer, shipping clerk, pickers-in-training, repairman, babysitters, housecleaners, cooks...they all take a part in making our Etsy shop a success! A merry heart doeth good like a medicine. Proverbs 17:22 Light is found in the home where laughter abounds.",
