policy_welcome: "You are here because you enjoy some of the the same things we do! Please read our policies and practices carefully. Questions are always encouraged and welcomed. If there is anything we can do to make your shopping experience better, we would love to hear your thoughts! A merry heart doeth good like a medicine. Proverbs 17:22",
policy_payment: "Payment is appreciated immediately after purchase. We are glad to HOLD ITEMS, at your request, for up to 5 business days. Snail mail payment must be made within that timeframe or item will be relisted. If you need a longer hold on an item, please convo me and I will consider your request. Longer holds may incur a non-refundable down payment.",
policy_shipping: "We make our best effort to accurately estimate shipping costs. Sometimes we aren&#39;t able to do so efficiently and it is possible to miss the mark. However, it is our policy to refund overages in excess of $2 only AT YOUR REQUEST (over $5 for very large items). Please convo us if you question the shipping charges and we will glady do a refund. SHIPPING TIMELINE: I will ship within 3-5 business days (excluding weekends) of receipt of payment. Here in our warehouse we package items on Mondays and Wednesdays (and sometimes every day in between!) Please make it known if you need a rush, we will accomodate if we can! DELIVERY METHODS: As a general rule, we use USPS standard shipping, but will use the most cost affective shipping option available at the time of post. As a courtesy we make it our practice to INSURE highly breakable and/or large sized items at no additional cost to you *when it is within in our ability to do so* based on cost and need. SHIPPING UPGRADES: Priority USPS or other carrier is offered at an ADDITIONAL COST. Additional shipper&#39;s insurance is available if you desire an UPGRADE not already included. Please make it known prior to placing your order for an estimate. Signature confirmation is available at additional cost. Yes, we ship INTERNATIONAL. Convo me your location for a quote. EXPLANATION OF SHIPPING ESTIMATES IN OUR LISTINGS: Etsy has a new shipping estimator so it is now much easier to accurately estimate shipping based on weight and size. However, not all of our older listings are updated yet. If you are questioning the cost of postage, please don&#39;t hesitate to convo us to check it out . . . we are always glad to save on shipping costs were we can and will always pass on the savings to our customers! If you live locally, we allow PICK UP and will refund all shipping charges. SHIPPING REFUNDS: As a matter of courtesy, we will gladly refund overages over $2 for items under 10 lbs. and overages of $5 for items over 10 lbs. (UPON REQUEST ONLY)",
policy_refunds: "NO RETURNS. Vintage items, by nature are not new, rarely perfect, and are sold AS IS. As always, we very much encourage your inquiries and will gladly provide additional photos necessary. It is always better to know the details before purchase and we will attempt to satify your requests for more information. If something was not displayed properly or was misrepresented convo me and we will so our best to work it out. Positive feedback is very important to us, and we would appreciate having the oppurtunity to satisfy any issues you may have. CHANGE YOUR MIND? If you change your mind BEFORE your item has been shipped, there will be a 5% return fee to cover our non-refundable Etsy listing and purchase fees. DIDN&#39;T RECEIVE YOUR PACKAGE? In the unlikely event that your INSURED package was lost in shipping, we will handle the insurance claim. USPS will not pay on a claim until the package has been reported missing for 30 days. At that time, we will begin the claims process which will require an affidavit from the buyer. For what ever reason, your shipment is UNCLAIMED upon delivery, and thus returned to us, we will refund your purchase price less a 25% restocking fee, ONLY at your request. Buyer pays all shipping charges. Returned items will be relisted for sale after 30 days. ITEM DAMAGED IN SHIPPING? The following applies only to items shipped USPS Priority or if additional INSURANCE was purchased at the time of shipping: Please inform us via Etsy convo of the damage and provide detailed photos and a written description. It can take up to 3-4 weeks for a claim to be processed. Light&Laughter will refund up to the insured amount only after USPS (or 3rd party insurer) pays out on the claim. Should an unforseeable event occur that requires an item be returned, Light&Laughter will consider on a case-by-case basis and may determine at our discretion to make a refund. Should this be decided there will be a restocking fee of 25%. Buyer always pays all shipping charges. ",
policy_additional: "Custom orders are always welcome. Convo me to inquire about pricing and options. Inquire about wholesale pricing for orders over qty of 25. We would welcome your PERSONAL REQUESTS FOR ESPECIALLY FOUND ITEMS. We have many resale contacts and go on buying trips locally and throughout the state of OH and VA on a regular basis. If there is a particular item you are looking for, we will gladly add you to our search list while scouting for our own stock. If you are looking for a specific item or desire our PICKERS SERVICES, again we are glad to accomodate! Convo us for additional info. PERSONAL SHOPPER fees run $25/hr plus trip charges.",
